import React, { useEffect } from "react";

const App = () => {
  useEffect(() => {
    let data = [
      {
        pseudo: "Moussa",
        age: 30,
        techno: ["Javascript", " nodeJs", "Pythion"],
        admin: true
      },
      {
        pseudo: "Yass",
        age: 18,
        techno: ["Php", " nodeJs", "Pythion"],
        admin: false
      },
      {
        pseudo: "Nicola",
        age: 70,
        techno: ["Ruby", " nodeJs", "Pythion"],
        admin: true
      },
      {
        pseudo: "Isaac",
        age: 17,
        techno: ["C++", " Java", "Pythion"],
        admin: false
      }
    ];
    for (let i = 0; i < data.length; i++) {
      console.log("ok");
    }
  });
  return <></>;
};

export default App;
